		function handleKeyPress(e) { // פונקציה האחראית על תזוזת המקשים
		
			if (isPlaying) { // משתנה הבודק אם השחקן משחק או סיים/עוד לא התחיל
				if (ispressed == false) { // בדיקה האם אחד המקשים לחוץ כבר
					if (e.keyCode == 37) {
						moveLeft();
						ispressed = true; // משנה את המצב ללחוץ כדי שהאינטרוול לא יפעל עוד פעם
					} else if (e.keyCode == 39) {
						moveRight();
						ispressed = true;
					} else if (e.keyCode == 38) { // אחראיות על המהירות
						var temp = speeds.findIndex(check_speed); // בודק באיזה מהירות המשחק נמצא כרגע ושומר למשתנה זמני
						if (temp < 4) {
							s = speeds[temp + 1]; // משנה למהירות החדשה
							isMoving = false;
							createjs.Ticker.setFPS(s); // משנה את מהירות הפריימים 
							if (s == speeds[0]) {
								background.getChildByName("speed_bar").gotoAndStop(0);
							} else if (s == speeds[1]) {
								background.getChildByName("speed_bar").gotoAndStop(1);
							} else if (s == speeds[2]) {
								background.getChildByName("speed_bar").gotoAndStop(2);
							} else if (s == speeds[3]) {
								background.getChildByName("speed_bar").gotoAndStop(3);
							} else if (s == speeds[4]) {
								background.getChildByName("speed_bar").gotoAndStop(4);
							}
						}
		
					} else if (e.keyCode == 40) {
						var temp = speeds.findIndex(check_speed);
						if (temp > 0) {
							s = speeds[temp - 1];
							isMoving = false;
							createjs.Ticker.setFPS(s);
							if (s == speeds[0]) {
								background.getChildByName("speed_bar").gotoAndStop(0);;
							} else if (s == speeds[1]) {
								background.getChildByName("speed_bar").gotoAndStop(1);
							} else if (s == speeds[2]) {
								background.getChildByName("speed_bar").gotoAndStop(2);
							} else if (s == speeds[3]) {
								background.getChildByName("speed_bar").gotoAndStop(3);
							} else if (s == speeds[4]) {
								background.getChildByName("speed_bar").gotoAndStop(4);
							}
						}
					}
		
				}
			}
		
		}
		
