		function nextAnswer() { // טעינת מסיח חדש
			ans_e = background.getChildByName("ans" + num);
			if (isPlaying) {
				if (ans_e.y > 450 && answersArr[mychoice][rndans].check == "yes" || intersect(player, ans_e) && answersArr[mychoice][rndans].check == "no") { // בדיקה לטעות של השחקן
					if (answersArr[mychoice][rndans].num_wrong < 1) {
						answersArr[mychoice][rndans].num_wrong++;
					}
					if (intersect(player, ans_e)) {
						show_ans_check_wrong(ans_e); // להראות וי אדום
					} else {
		
						background.removeChild(ans_e);
						num++;
						rndans = parseInt(Math.random() * (answersArr[mychoice].length));
						answers(); // לטעון את השאלה הבאה
					}
		
		
				} else if (ans_e.y > 450 && answersArr[mychoice][rndans].check == "no" || intersect(player, ans_e) && answersArr[mychoice][rndans].check == "yes") { // בדיקה להצלחה של השחקן
					if (answersArr[mychoice][rndans].check == "yes") {
						show_ans_check(ans_e); // להציג וי ירוק במקרה של הצלחה
					} else if (answersArr[mychoice][rndans].check == "no") {
						var treasure = new lib.treasure();
						storage_place.getChildByName("storage" + storage_num).addChild(treasure);
						storage_place.getChildByName("storage" + storage_num).alpha = 1;
						storage_num++;
						background.removeChild(ans_e);
						var temp = answersArr[mychoice].slice(rndans, rndans + 1); // שומר את השאלה שנבדקה פונקציה ומכניס אותה למערך חדש שיופיע במסך הסיום
						display_answers.push(temp);
						answersArr[mychoice].splice(rndans, 1); // הוצאת המסיח מהמערך כדי שלא יחזור
		
						if (answersArr[mychoice].length == 0) { // במקרה שנגמרו המסיחים סיום משחק
							clearInterval(movebackground);
							isPlaying = false;
							analasys();
						} else {
							num++;
							rndans = parseInt(Math.random() * (answersArr[mychoice].length));
							answers();
						}
					}
				}
			}
		}
		
